public String toString() {
  StringBuilder builder = new StringBuilder();
  if (this.previous == null)
    builder.append("||-");
  else
    builder.append(this.previous.idx + " <- ");
  builder.append(this.idx);
  if (this.next == null)
    builder.append(" -||");
  else
    builder.append(" -> " + this.next.idx);
  return builder.toString();
}

